  const {user} = useSelector((state) => state.profile);
  const navigate = useNavigate();

  return (
    <div>

      <h1>
        My Profile
      </h1>

      <div>
        <div>
          <img/>
          <div>
            <p></p>
            <p></p>
          </div>
        </div>
      </div>
    </div>
  )
}
